import React from 'react';
import { BrowserRouter, Switch, Route} from 'react-router-dom';
import Header from './components/Header';
import Home from './pages/Home';

const Routes = () => (

    <BrowserRouter>
        <Header />
        <Switch>
            <Route path = "/">
                <Home/>
            </Route>
        </Switch>

    </BrowserRouter>



);

export default Routes;
